import React from 'react';

class Shortcuts extends React.Component{
  render(){
    return (
      <div class="shortcut">        
        <button>{this.props.sales} Promociones</button>   
        <button>{this.props.sales} Menus</button>   
        <button>{this.props.sales} Extras</button>
        <button>{this.props.sales} Despacho</button>         
      </div>
    );
  }
}

export default Shortcuts;
